CREATE TABLE IF NOT EXISTS syslog.rh_ausencia (
	id INTEGER UNSIGNED NOT NULL AUTO_INCREMENT, 
	clave_trab INTEGER UNSIGNED NOT NULL, 
	id_plaza INTEGER UNSIGNED NOT NULL,
	clave_plaza VARCHAR(20) NOT NULL,
	id_motivo INTEGER UNSIGNED NOT NULL, 
	clave_motivo CHAR(3), 
	fec_inicio DATE NOT NULL, 
	fec_termino DATE NOT NULL, 
	fec_reanuda DATE NULL, 
	req_cobertura TINYINT(1) NOT NULL DEFAULT 0, 
	doc VARCHAR(80) NULL, 
	descr TEXT NULL, 
	referencia VARCHAR(80) NULL,
	PRIMARY KEY(id), 
	INDEX IDX_ausencia(clave_trab, clave_plaza), 
	INDEX IDX_clave_motivo(clave_motivo ASC),
	CONSTRAINT FK_clave_trab FOREIGN KEY (clave_trab) REFERENCES syslog.rh_trab(clave) 
		ON DELETE CASCADE ON UPDATE NO ACTION, 
	CONSTRAINT FK_id_plaza FOREIGN KEY (id_plaza) REFERENCES syslog.rh_plaza(id) 
		ON DELETE CASCADE ON UPDATE NO ACTION, 
	CONSTRAINT FK_id_tipo FOREIGN KEY (id_motivo) REFERENCES syslog.rh_ausencia_motivo(id) 
		ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARACTER SET=utf8 COLLATE=utf8_spanish_ci;


